import React, { useState } from "react";
import "./App.scss";

let [number, setNumber] = useState(0);

const App = () => {
	return (
		<div>
			<h1>{number}</h1>
			<button onClick={ () => {setNumber(number +1)}}>
				Plus
			</button>
		</div>
	)
}

export default App;
